SELECT COUNT(DISTINCT O_model_list.Model), COUNT(DISTINCT O_car_names.Model) FROM car_names O_car_names JOIN model_list O_model_list ON O_model_list.Model=O_car_names.Model WHERE O_model_list.Maker IN (SELECT I_model_list.Maker FROM model_list I_model_list WHERE (I_model_list.Model != "honda" AND (I_model_list.ModelId > 31.0 OR I_model_list.ModelId < 32.0)))
SELECT O_model_list.Maker, O_cars_data.Edispl FROM car_names O_car_names JOIN cars_data O_cars_data JOIN model_list O_model_list ON O_car_names.MakeId=O_cars_data.Id AND O_model_list.Model=O_car_names.Model WHERE ((O_car_names.MakeId < (SELECT I_car_names.MakeId FROM car_names I_car_names WHERE (I_car_names.Model != "amc" OR I_car_names.Model != "audi")) OR O_model_list.ModelId >= 1.0) OR O_cars_data.Weight >= 2592.0)
SELECT MIN(O_cars_data.MPG), SUM(O_cars_data.Id) FROM cars_data O_cars_data WHERE O_cars_data.Id IN (SELECT I_cars_data.Id FROM cars_data I_cars_data WHERE (I_cars_data.Year < 1982.0 AND I_cars_data.Edispl >= 105.0))
SELECT * FROM countries O_countries WHERE (O_countries.CountryId != 1.0 OR O_countries.CountryId <= (SELECT I_countries.CountryId FROM car_makers I_car_makers JOIN countries I_countries ON I_countries.CountryId=I_car_makers.Country WHERE I_car_makers.Id != 2.0))
SELECT * FROM countries O_countries WHERE O_countries.CountryName IN (SELECT I_countries.CountryName FROM car_makers I_car_makers JOIN countries I_countries JOIN model_list I_model_list ON I_car_makers.Id=I_model_list.Maker AND I_countries.CountryId=I_car_makers.Country WHERE ((I_model_list.Model LIKE "honda%" AND I_countries.CountryId = 4.0) OR I_model_list.ModelId = 13.0))
SELECT * FROM car_names O_car_names JOIN model_list O_model_list ON O_model_list.Model=O_car_names.Model WHERE (O_car_names.MakeId NOT IN (SELECT I_car_names.MakeId FROM car_names I_car_names WHERE I_car_names.Model NOT IN "('amc','cadillac','volvo','datsun','citroen')") OR O_model_list.Model LIKE "honda%")
SELECT O_car_makers.Country, O_car_makers.Id FROM car_makers O_car_makers JOIN countries O_countries ON O_countries.CountryId=O_car_makers.Country WHERE (O_car_makers.Country = 1.0 AND (O_car_makers.FullName != (SELECT I_car_makers.FullName FROM car_makers I_car_makers WHERE I_car_makers.Maker != "bmw") OR O_countries.CountryId = 1.0))
SELECT MAX(O_countries.CountryId) FROM countries O_countries WHERE (O_countries.CountryName IN "('egypt','australia','france','mexico','nigeria')" AND O_countries.CountryId >= (SELECT I_countries.CountryId FROM continents I_continents JOIN countries I_countries ON I_continents.ContId=I_countries.Continent WHERE I_continents.Continent IN "('america','europe')"))
SELECT O_countries.Continent FROM car_makers O_car_makers JOIN continents O_continents JOIN countries O_countries ON O_continents.ContId=O_countries.Continent AND O_countries.CountryId=O_car_makers.Country WHERE (O_continents.Continent IN (SELECT I_continents.Continent FROM continents I_continents JOIN countries I_countries ON I_continents.ContId=I_countries.Continent WHERE (I_continents.Continent NOT LIKE "%asia" OR I_countries.Continent != 1.0)) OR (O_car_makers.Maker NOT LIKE "amc%" OR O_countries.CountryId = 4.0))
SELECT O_cars_data.Cylinders, O_cars_data.Weight FROM cars_data O_cars_data WHERE O_cars_data.Cylinders NOT IN (SELECT I_cars_data.Cylinders FROM cars_data I_cars_data WHERE (I_cars_data.Edispl = 85.0 OR (I_cars_data.Weight != 2950.0 OR I_cars_data.Year <= 1982.0)))
